import React, { useState, useEffect } from "react";
import "./Events.css";
import axios from "axios";
import { Link } from "react-router-dom";
const TouristEvents = () => {
  const [searchQuery, setSearchQuery] = useState("");

  const [events, setEvents] = useState([
    {
        event_id: 1,
      name: "City Tour",
      location: "New York",
      date: "2023-06-01",
      imageUrl: "data:image/jpeg;base64,",
    },
    {
        event_id: 2,
      name: "Beach Party",
      location: "Miami",
      date: "2023-06-05",
      imageUrl: "data:image/jpeg;base64,",
    },
    {
        event_id: 3,
      name: "Historical Walk",
      location: "Paris",
      date: "2023-06-10",
      imageUrl: "https://static.toiimg.com/photo/31901592.cms",
    },
       
    {
        event_id: 4,
        name: "Dj night",
        location: "Delhi",
        date: "2023-06-10",
        imageUrl: "https://media.istockphoto.com/id/841506898/photo/enjoying-great-concert.jpg?s=612x612&w=0&k=20&c=Xp3jzTqDk9XbD5WV26tKNaig_ql2v-tafXGiMnUsJ-o=",
      },
      {
        event_id: 5,
        name: "Games",
        location: "Rajasthan",
        date: "2023-06-10",
        imageUrl: "data:image/jpeg;base64,",
      },
      {
        event_id: 6,
        name: "Food fest",
        location: "Chennai",
        date: "2023-06-10",
        imageUrl: "data:image/jpeg;base64,",
      },
      {
        event_id: 7,
        name: "Visiting museums",
        location: "Dubai",
        date: "2023-06-10",
        imageUrl: "https://cdn.britannica.com/51/194651-050-747F0C18/Interior-National-Gallery-of-Art-Washington-DC.jpg",
      },
      {
        event_id: 8,
        name: "Music concerts",
        location: "Hyderabad",
        date: "2023-06-10",
        imageUrl: "https://experiencesandevents.nd.edu/assets/479224/1200x800/garth_brooks_concert_1543.jpg",
      },
    // Add imageUrl for other events
  ]);
  useEffect(() => {
    // Fetch events data from API endpoint
    axios
      .get("https://api.example.com/events")
      .then((response) => {
        setEvents(response.data);
      })
      .catch((error) => {
        console.error("Error fetching events:", error);
      });
  }, []); // Empty dependency array to run the effect only once

  const handleSearchChange = (e) => {
    setSearchQuery(e.target.value);
  };

  const filteredEvents = events.filter((event) => {
    const searchLower = searchQuery.toLowerCase();
    return (
      event.name.toLowerCase().includes(searchLower) ||
      event.location.toLowerCase().includes(searchLower)
    );
  });

  return (
    <div className="tourist-events">
      <br></br><h1>Tourist Events</h1>
      <div className="search-box">
        <input
          type="text"
          className="search-input"
          placeholder="Search events and locations"
          value={searchQuery}
          onChange={handleSearchChange}
        />
      </div>
      <div className="event-list">
        {filteredEvents.map((event) => (
          <div key={event.id} className="event-item">
            <img
              src={event.imageUrl}
              alt={event.name}
              className="my-eventimage"
            />
            <div className="event-details">
              <h3>{event.name}</h3>
              <p>
                <strong>Location:</strong> {event.location}
              </p>
              <p>
                <strong>Date:</strong> {event.date}
              </p>
              <Link to="/clogin">
              <button className="event-button">Book</button>
              </Link>
            </div>
          </div>
        ))}
        {filteredEvents.length === 0 && (
          <p>No events found matching the search criteria.</p>
        )}
      </div>
    </div>
  );
};

export default TouristEvents;
